    def canFinish(self, numCourses, prerequisites):
        """
        :type numCourses: int
        :type prerequisites: List[List[int]]
        :rtype: bool
        """
        if not prerequisites:
            return True
        visited = {n: 0 for n in range(numCourses)}
        for n in xrange(numCourses):
            if not self.dfs(visited, n, prerequisites):
                return False
        return True
        
    def dfs(self, visited, element, prerequisites):
        if visited[element] == -1:
            return False
        if visited[element] == 1:
            return True
        visited[element] = -1
        for li in prerequisites:
            if li[0] == element:
                if not self.dfs(visited, li[1], prerequisites):
                    return False
        visited[element] = 1
        return True


